Flag indicating PRACH position (0: low, 1: high)
if (prachFreqOff <= (ulChBw/2 - 3)) {
   flagPRACHposition = Low
}
else {
   flagPRACHposition = High
}
Here prachFreqOff is the IE included in MAC_RachSetupReq, ulChBw is the IE included in MAC_CellSetupReq.
[BR/][B]Valid from inc:[/B] Inc17 
[BR/][B]Parameter name in DCM L1/L2 spec:[/B] FlagPRACH,Position
[BR/][B]Chapter in DCM L1/L2 spec:[/B] 3.3.3
